import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import DashBoard from '../SideBarPages/DashBoard';
import Materials from '../SideBarPages/Materials';
import Components from '../SideBarPages/Components';
import Products from '../SideBarPages/Products';
import CustomSideBar from '../CustomSideBar';
import NavBar from '../NavBar';
import {createTheme, ThemeProvider } from '@material-ui/core/styles';
import 'C:/Users/Hieu/my-app/src/App.css';

const theme = createTheme({
  App: {
    backgroundColor: "#FAFAFA"
  },
  palette: {
    primary: {
      main: "#2e1667"
    },
    secondary: {
      main: "#c7d8ed"
    },
  },
  typography: {
    fontFamily: [
      'Arial'
    ],
    h4: {
      fontWeight: 600,
      fontSize: 28,
      lineHeight: '2rem'
    },
    h5: {
      fontWeight: 600,
      lineHeight: '2rem'
    }
  }
})

function Accounts() {
  return (
    <div className="App">
      <ThemeProvider theme={theme}>
        <NavBar />
        <Router>
          <Router>
            <CustomSideBar />
            <Routes>
              <Route path='/' exact element={<DashBoard />}></Route>
              <Route path='/accounts' exact element={<Accounts />}></Route>
              <Route path='/materials' exact element={<Materials />}></Route>
              <Route path='/products' exact element={<Products />}></Route>
              <Route path='/components' exact element={<Components />}></Route>

            </Routes>
          </Router>
        </Router><center><h1>Accounts</h1></center>
      </ThemeProvider></div>
  )
}

export default Accounts
